var dialog={"pogen_alert":"%s traductions manquent, tape 'pogen' pour télécharger le fichier de traduction avec les nouvelles entrées.","prelude_tuto":"= Geek Fighter II =\nBattez le super ordinateur avec les flèches, Entrée ↵  et  Tab ↹.\nTu peux aussi invoquer des sorts en les écrivant rapidement 'ls', 'cat', ou encore 'cd'.","prelude_tab":"Quel beau coup de pied. Tu appuies sur Tab ↹ formidablement bien.","prelude_enter":"Quel beau coup de point. Tu appuies sur Entrée ↵ formidablement bien.","prelude_success_cmd":"Quel beau coup !","prelude_enemy_kill":"Cet ordi est foutu.","prelude_wrong_game":"Tu concentres ton énergie, tu lances ce sort puissant... Où te crois tu ? Dans un dessin animé ?","you_learn":"Tu as appris à utiliser %s !","you_unlock":"Tu peux maintenant aller dans %s !","you_success":"Fini '%s' !","new_path":"Regarde avec 'ls', tu peux maintenant aller à cet endroit : '%s' !","congrat":"Félicitation ! Tu as résolu toutes les enigmes de %s !","press_enter":"Appuie sur la touche Entrée ↵","press_tab":"Appuie sur la touche Tab ↹","cookie":"Afin de conserver ton avancement dans le jeu, il faut manger un cookie.\nVeux tu activer les cookies ?","cookie_yes":"oui (nouveau jeu)","cookie_yes_load":"oui (reprendre la partie en cours%s)","cookie_no":"non (pas de sauvegarde)","yes":"oui","no":"non","item_none":"Objet","item_none_text":"Cet objet n'a rien de particulier.","item_intro":"C'est un-e %s.","people_none":"Personne","people_none_text":"Cette personne ressemble plutôt à un robot.","cannot_cast":"Cette commande ne peut pas être utilisée ici.","cmd_exit":"Au revoir !","gameintro_text_initrd":"Chargement de initrd.img [<div class='inmsg' id='initload'></div>]","gameintro_text_domainname":"Configuration du nom de domaine [<div class='inmsg' id='domainsetup'></div>]\n ","gameintro_text_fsck":"Vérification du système de fichier [<div class='inmsg' id='initfsck'></div>]\n ","gameintro_ok":"OK","gameintro_failure":"Échec","gameintro_text_terminus":"   Bienvenue dans {{room.Terminus}}\n \n ","gamestart_text":". . .\n\nLe réveil est difficile.\nIl semble que tu aies perdu la mémoire.","cmd":"%s","room":"%s","room_unreachable":"La pièce %s est inatteignable.","room_unreadable":"Un brouillard dans la pièce empêche de voir son contenu.","people_shell":"Palourde","people_shell_text":"<voice grl/>Pour ce qui est de se déplacer écris '{{cmd.cd}}' suivi d'un chemin et pour voir aux alentours écris '{{cmd.ls}}'.\n Se déplacer dans un chemin n'est possible que si tu connais le chemin.\nIl te faudra surement écrire '{{cmd.ls}}' partout où tu passe.","people_shell_text1":"<voice grl/>Savais tu que lorsque tu appuies sur Tab ↹ , des suggestions apparaissent sous ta ligne de commande ?\nLorsque il n'y a plus qu'un mot qui peut être suggéré, ta ligne de commande (en bas) se rempli  toute seule.\nPour constater cela, il suffit de commencer à écrire un mot et de taper sur Tab ↹.","people_shell_text2":"<voice grl/>Connais tu la commande '{{cmd.pwd}}' ?\nSi tu écris cette commande (et que tu valides en appuyant sur la touche Entrée ↵), tu auras des informations sur l'endroit où tu te trouves.","people_shell_text3":"<voice grl/>Savais tu que lorsque tu appuies sur les flèches Haut et Bas, naviguer dans l'historique. C'est à dire que tu peux réutiliser les commandes que tu viens d'entrer.","people_shell_text4":"<voice grl/>Savais tu que lorsque tu appuies sur les touches Ctrl et U, le texte avant le curseur dans la ligne de commande est effacé. ","people_shell_text5":"<voice grl/>Savais tu que lorsque tu appuies sur les touches Ctrl et C, tu interromps l'action en cours.","people_shell_text6":"<voice grl/>Sais tu ce qu'est une expression régulière ? Non ? Par exemple \"Bo*\" est une expression régulière pour \"Bonbon\", mais aussi pour \"Bobine\" et tous les mots commençant par les lettres B o.\n Le caractère * (astérisque) signifie, n'importe quel caractère, autant de fois que possible.","people_shell_text0":"<voice grl/>Je n'a ni yeux ni jambes.\nJe me déplace avec '{{cmd.cd}}'.\nJe vois les routes et obstacles avec '{{cmd.ls}}'.\nJ'examine le contenu avec '{{cmd.cat}}' ou parfois avec un éditeur.\nEt parfois, j'exécute...","msg_from":"Message de %s sur %s à %s :","very_first_try":". . .\n\nTu m'as l'air de ne pas y voir grand chose dans ce brouillard.\n\nQui es tu ? \n\nAs tu un lieu où aller ? \n\n Tu ne sais pas ?\n\nRappelles toi ces bases si tu ne veux pas tomber dans l'oubli :\n1. en écrivant '{{cmd.cat}}' ( ? ), tu pourras examiner en détails\n2. en écrivant '{{cmd.ls}}' (LiSter), tu pourras voir ce qui croise ton chemin\n3. en écrivant '{{cmd.cd}}' (Changer de Destination), tu pourras aller ailleurs.","cmd_cat_first_try":"J'ai oublié de te dire que {{cmd.cat}} doit être suivi du nom d'une personne ou d'un objet.","cmd_cat_second_try":"Tiens ! là ! il y a une {{people_shell}}, on pourrait lui demander comment elle a fait pour venir jusqu'ici.\nVous vous connaissez peut-être.\n Tu n'as qu'à écrire '{{cmd.cat}} {{people_shell}}' pour engager cette passionante discussion.","cmd_exit_html":"<p>Terminus a été arrêté.</p><p>Au revoir !</p>","cmd_cd":"Tu entres dans %s. %s","cmd_cd_failed":"Il n'existe aucun chemin appelé %s. Retourne te coucher.","cmd_cd_no_args":"'{{cmd.cd}} ~' pour retourner au point de départ.","cmd_cd_no_args_pwd":"'{{cmd.pwd}}' pour savoir où tu es.","cmd_cd_flood":"À moins de te dédoubler, tu ne peux pas aller dans plusieurs endroits en même temps.","cmd_cd_home":"Tu es de retour à la maison !","cmd_cd_no_parent":"Tu ne peux plus rebrousser chemin.","cmd_cd_parent":"Tu es entré-e dans %s. %s","cmd_cp_copied":"%s vient d'être copier dans %s.","cmd_cp_unknown":"Je ne vois aucun objet qui pourrait porter ce nom.","tgt_already_exists":"'%s' existe déjà.","item_not_exists":"L'objet '%s' n'existe pas.","cmd_help_begin":"Tu peux utiliser les commandes suivantes :","cmd_less_no_arg":"(Pour que ça fonctionne, {{cmd.cat}} doit être suivi d'un sujet à examiner : un objet ou une personne présente dans l'endroit où te trouves)","cmd_less_missing":"%s n'a pas été(e) trouvé.","cmd_man_no_query":"Il faut poser une question pour obtenir une réponse. C'est ce que dit le grand manuscrit.","cmd_man_not_found":"Il n'y a rien d'écrit dans le grand manuscrit.","cmd_not_found":"La commande '%s' est introuvable.","cmd_mv_done":"%s a été déplacé(e) vers %s.","cmd_mv_name_done":"%s a été renommé(e) %s.","cmd_mv_overwrite_done":"%s a été renommé(e) en %s (qui a été écrasé(e)).","cmd_mv_flood":"Il est possible de déplacer un objet dans un emplacement en indiquant son chemin.  \nPour cela, utilise 'mv OBJET CHEMIN'.","cmd_mv_invalid":"Il faut un objet et un emplacement de destination pour réaliser un déplacement.","cmd_mv_fixed":"Ceci ne peut être déplacé.","cmd_mv_dest_fixed":"Impossible de mettre ça dans cette pièce.","room_not_writable":"Impossible de mettre ça dans cette pièce.","permission_denied":"(Permission non accordée)","cmd_pwd":"Tu te trouves dans %s.","cmd_rm_done":"Tu viens de supprimer %s. Ses données disparaissent devant tes yeux.","cmd_rm_failed":"Voilà quelque chose que tu ne peux pas détruire.","cmd_rm_invalid":"Tu ne peux supprimer qu'un objet existant sans grande importance pour autrui.","cmd_rm_miss":"Si il s'agit d'une chose particulière que tu cherches à supprimer. Cela ne suffira pas.","cmd_touch_created":"Tu viens de créer : %s !","cmd_touch_none":"Tu as tenté de créer quelque chose. Mais personne ne sait de quoi il s'agit. Vérifie ta syntaxe.","cmd_touch_nothing":"Tu dois indiquer ce que tu cherche à créer pour que cela marche.","cmd_unknown":"Tu n'as pas encore appris cette commande.","combo":"La combinaison est 'terminus' (sans les guillemets).","directions":"Là où tu peux aller (chemins):\n%s ","incorrect_syntax":"La syntaxe est incorrecte. Pour en savoir plus : '{{cmd.man}} %s'","invalid_spell":"Cette commande n'existe pas","items":"Ici, tu peux interagir avec (objets):\n%s","peoples":"Ici, tu peux parler avec :\n%s","lock_added":"Tu viens d'ajouter le verrou %s","room_empty":"Cette pièce est vide. Il n'y a rien.","room_new_created":"Tu viens de créer un nouveau chemin : %s","room_wrong_password":"Le mot de passe est erroné. As tu oublié ton mot de passe ? Non, je blague. Déguerpissez !","room_wrong_syntax":"La syntaxe n'est pas valide. Relisez les instructions.","room_none":"LieuBanal","room_none_text":"C'est un endroit très banal.","room_home":"Départ","room_home_text":"De retour au point de départ... ","room_western_forest":"BoisDesLutins","room_western_forest_text":"Tu es entré-e dans la foret des Lutins . Le chemin semble mener à une école.\nUn panneau indique \"Académie des Bots : Grande école de Sorcellerie du Grand Ordinateur. \"","room_spell_casting_academy":"AcadémieDesBots","room_spell_casting_academy_text":"Le hall d'entrée est bondé. \nL'académie a un plafond très haut ce qui rend l'entrée très impressionnante.","item_western_forest_academy_direction":"Panneau","item_western_forest_academy_direction_text":"Académie des Bots : Grande école de Sorcellerie du Grand Ordinateur.\nÀ ne pas manquez aujourd'hui : Leçon d'initiation aux commandes !","item_western_forest_back_direction":"RentreChezToi","item_western_forest_back_direction_text":"À tous moment, si tu veux revenir au point de départ, \nécris juste la commande '{{cmd.cd}} ~' ou '{{cmd.cd}}'. \nSi tu es perdu(e), écris '{{cmd.pwd}}'.","item_practice":"Pilier%d","item_practice_text":"Il s'agit d'un objet conçu pour  l'entrainement","room_academy_practice":"SalleDEntrainement","room_academy_practice_text":"La pièce est remplie de noobs comme toi et d'élèves pratiquant leur nouvelles commandes.","item_academy_practice":"Note","item_academy_practice_text":"Attention : ne déplacer les Piliers.","room_box":"Boîte","room_box_text":"Cette boîte est trop petite pour entrer dedans.","room_meadow":"Prairie","room_meadow_text":"C'est une grande et belle prairie verte. Un majestueux {{people_poney}} s'y trouve. Il a l'air triste et solitaire.","people_poney":"Poney","people_poney_text":"Pour ne pas lui faire peur, tu restes à distance du poney.\nAprès quelques instants, vous arrivez à communiquer avec quelques hochements de tête.\nFinalement, le poney bascule sa tête vers les {{room_mountain}} à l'est comme s'il te suggérait d'aller dans cette direction.","people_poney_text1":". . .","people_poney_text2":"Pour ne pas lui faire peur, tu restes à distance du poney.\nTu hoches la tête vers les nuages.\nLe poney te répond par le même signe.","people_poney_text3":"Tu restes à distance du poney.\nTu hoches la tête vers le sol.\nLe poney fronce son gros visage.","people_poney_text4":"Tu restes à distance du poney.\nTu hoches la tête encore une fois, en dessinant des cercles avec ton nez.\nLe poney s'approche.","people_poney_text5":"Tu hoches encore la tête. Le poney accourt vers toi.\n«<voice poney/> Hey ! » <voice char/>dit le poney.«<voice poney/> C'est très gentil de te soucier de moi, et j'aimerai bien m'amuser avec toi,\n mais je suis persuadé que tu as mieux à faire » .","people_poney_textmountain":"Tu hoches encore la tête. Le poney accourt vers toi.\n«<voice poney/> Hey ! » <voice char/>dit le poney.«<voice poney/> As tu déjà visité les {{room_mountain}} ? » .","people_poney_texttab":"«<voice poney/> Hey ! Savais tu qu'en appuyant sur la touche 'tab', tu pouvais aller beaucoup plus vite ?»","people_poney_textmv":"«<voice poney/> J'ai compris ! Tu es bloqué » <voice char/>dit le poney.«<voice poney/> As tu essayé de parler à un {{people_professor}} de l'{{room_spell_casting_academy}} ? » .","people_poney_texthelp":"«<voice poney/> J'ai compris ! Tu es bloqué » <voice char/>dit le poney.«<voice poney/> Désolé, je ne suis pas en mesure de t'aider.\nmais si tu as déjà lu le {{item_man}} tu dois pouvoir utiliser '{{cmd.help}}' » .","room_mountain":"Montagnes","room_mountain_text":"Tu parcours un sentier de montagne qui mène à une cave.\nSur ce sentier tu croises un vieil homme.","people_man_sage":"VieilHomme","people_man_sage_text":"Tu parles avec le vieil homme.\nIl te salue chaleureusement comme si vous vous connaissiez déjà. \n« Salut toi ! \nTu as l'air jeune et intrépide.\nSi tu as le cœur assez brave, alors ton destin t'attend dans cette cave.\nTu y trouvera un portail qui te mènera au chapitre suivant. »\nLe vieil homme devine l'inquiétude qui te passe par la tête,\net te dit en souriant\n« Tiens, prends ce manuscrit qui t'enseignera comment utiliser tes pouvoirs.»\nLe vieil homme pose le {{item_man}} par terre et s'en va.\n« Au revoir ! Au fait si tu ne te sens pas de taille tape '{{cmd.exit}}'. »","item_man":"Manuscrit","item_man_text":"Si tu oublies des sorts,\ntape \"help\" et une liste des sorts utilisables apparaîtra .\nSi tu veux connaître les détails d'utilisation d'un sort,\ntape 'man' suivit de la commande.\nPar exemple, si tu veux savoir comment utiliser \"mv\", alors tape : \"man mv\"","room_lessons":"Cours","room_lessons_text":"Tu entres dans la salle où sont dispensés les cours.\nC'est beaucoup plus calme ici. Il semble que ça ait déjà commencé et que ça parle du \"Sort de déplacement.\"","people_professor":"Professeur","cmd_syntax_lesson":"Syntaxe générale des commandes: Les commandes élémentaires sont de la forme :> {{cmd.commande}} {{item.fichiers_ou_données}}La commande apparaissant en début de ligne est presque toujours le nom d'un programme. Ce programme peut être une commande du système d'exploitation, un logiciel écrit par un utilisateur (souvent en langage C) ou un shell. Quelques rares commandes comme la commande cd (changement de dossier / répertoire) ne peuvent pas être traitées correctement par un logiciel spécifique. Elles sont dans ce cas directement exécutées par l'interpréteur de commandes.Certaines de ces commandes peuvent s'exécuter en tapant au clavier seulement leur nom. Mais la plupart des commandes acceptent des options (un tiret suivi d'une ou plusieurs lettres) qui permettent d'utiliser la commande autrement que dans son mode de fonctionnement par défaut. Enfin, bon nombre de commandes sont suivies d'un ou plusieurs noms de fichier, répertoire ou autre, avec lesquels elles vont travailler. Toutes les informations séparées par des espaces à droite du nom de la commande sont appelées arguments de la ligne de commandes.","people_professor_text":"Le prof dit un tas de choses qui ressemble pour toi à du charabia,\n mais tu as réussi à comprendre 3 choses: \n1. '{{cmd.mv}}' sert à déplacer des objets \n2. il faut indiquer le nom de l'objet et de la destination ({{cmd.mv}} OBJET CHEMIN) \n3. Ce sort ne marche pas sur tous les objets, mais tu n'as pas réussi à suivre lesquels n'étaient pas déplaçables.","people_professor_textquit":"« Oh oh ! c'est pas bon, tu devrais partir. Tout de suite ! Tu peux écrire '{{cmd.cd}} ~'» ","leave_academy":"La salle d'entrainement va s'écrouler : fuis !","room_cave":"Cave","room_cave_text":"Cet endroit est typiquement une cave : sombre et humide, avec une légère odeur de moisissure.","room_dark_corridor":"SombreCorridor","room_dark_corridor_text":"Tu traverses le sombre corridor et trouves au bout une petite pièce humide.","room_staircase":"Escalier","room_staircase_text":"L'escalier de pierre mène à un cul de sac confirmé par un panneau.","item_dead_end":"Panneau","item_dead_end_text":"Voie sans issue","room_dank":"PièceHumide","room_dank_text":"Cette pièce est encore plus sombre.","item_boulder":"Rocher","item_boulder_text":"Tu sens un léger courant d'air passer derrière le rocher.","room_small_hole":"PetiteCrevasse","room_small_hole_text":"Il n'y a rien de très exaltant dans cette crevasse rempli de saletés.\n Cette crevasse est à peine plus volumineuse que le rocher. ","room_small_hole_cd":"Pas très exaltant comme endroit. \nJe veux sortir.","room_tunnel":"Tunnel","room_tunnel_text":"Le taux d'humidité ici est très élevé.\nTu reçois des gouttes d'eau sur la figure.\nTu as remarqué une touffe de poil se déplaçant à ta droite.\nAu bout de tunnel, il y a une porte ouverte.","people_rat":"TouffeDePoils","people_rat_identified":"Rat","people_rat_text":"Tu inspectes avec tes mains la touffe de poils et tu détermines qu'il s'agit d'un rat… De la taille d'un petit chien. Il ou elle t'a mordu. \nCette expérience ne t'a faite guère plaisir.","people_rat_identified_text":"(Oh, pardon, excusez moi de ma maladresse !)","people_rat_identified_text1":"(On peut se tutoyer ?)","people_rat_identified_text2":"(Oh, pardon, excuse moi de ma maladresse !)","people_rat_identified_text3":"(Je n'ai rien à t'apprendre et tu souhaites tout de même me parler ?)","people_rat_identified_text4":"(Es tu venu sauver Terminus ?)","room_stone_chamber":"ChambreDePierre","room_stone_chamber_text":"La pièce entière rayonne d'une lueur verte. \nLa source de cette lumière est un portail magique placé en plein milieu de la pièce. \nC'est sûrement le portail dont parlait le vieil homme.","room_portal":"Portail","room_portal_text":"Tu as été transporté à travers les ages...","room_townsquare":"PlaceDuVillage","room_townsquare_text":"La place du village est grande, ronde et ensoleillée.\n Au centre,  il y a un piédestal fait de pavés.\nL'architecture est très jolie, mais tout le monde semble nerveux.","people_citizen1":"Canard","people_citizen1_":"Jasper","people_citizen1_text":"Tu t'adresses à un des villageois  : \"Excusez-moi,\". Il se retourne, surpris. \n\"Quoi ?! … euh, bonjour ! Bienvenue à Terminus.\\","people_citizen1__text":"Hmmm. Des questions ? Vas-y.","people_citizen1__text1":"Hmmm. Si tu as besoin d'équipements, je te conseille la {{room_market}} et la {{room_artisanshop}}.","people_citizen1__text2":"Hmmm. Si tu as besoin d'informations, je te conseille la {{room_library}}.\\","people_citizen2":"VielHomme","people_citizen2_text":"Ce villageois lit le journal quand il remarque que tu le regarde. \n\"As tu lu ça ?\" s'eclaffe t'il, secouant la dernière édition du \"Dernier Mot\" devant ton visage.\n\"Ça dit que {{people_darkwizard_pre}} {{people_darkwizard}} a répandu la corruption de Oseton jusqu'au sud, et Konsole est déjà atteint !\nCes temps sont dangereux,\" \nil marmone, secouant sa tête et retournant à sa lecture.","people_citizen3":"Villageoise","people_citizen3_text":"La villageoise pleure et tremble incontrolablement. \n\"My baby,\" pleure t'elle, \n\"They kidnapped my baby! I just know that wizard had something to do with it.\"","people_citizen3_text1":"\"My baby... i will '{{cmd.pkill}} -9 {{people_darkwizard}}'.\"","people_citizen3_text2":"(Tu ne sais pas quoi dire...)","people_citizen3_text3":"(Tu as beau réfléchir.\nLa seule chose qui soulagerait cette maman serait de retrouver son enfant.)","people_citizen3_text4":"\"I will {{cmd.rm}} theses trolls.\"","people_citizen3_text5":"\"But... who have the power to do that ? Do you ?\"","room_market":"PlaceDuMarché","room_market_text":"Les commerces sont alignés formant une longue ligne droite.","people_vendor":"Vendeur","people_vendor_text":"\" Bonjour !\", le vendeur te sourit de manière déplaisante.\n\" Que souhaites-tu acheter ? \"","people_vendor_sell_nothing":"(passer son chemin)","people_vendor_sell_rm":"le sort 'rm' qui coûte {{item_rm_cost}}","people_vendor_sell_mkdir":"le sort 'mkdir' qui coûte {{item_mkdir_cost}}","you_buy":"Tu as acheté %s","need_money":"Tu n'as pas de quoi acheter ce sort.","unzipped":"Dans %s, tu as trouvé ces choses : %s","item_mkdir_cost":"5000","item_rm_cost":"10000","people_vendor_rm":"\"Hey! Ce sort ne marche pas sur tout, tu sais.\nJ'aurai dû le mentionner avant de te le vendre...\"","item_cmd_unknown":"Cela ne marche pas.","item_rm_spell":"rm","item_rm_spell_text":"\"Ah, oui, le sort 'rm',\" le vendeur songe. \n\"Dis juste 'rm' suivi du nom de l'objet ou de la personne, \net cela causera sa disparition... pour toujours. \nAs tu les trippes pour l'utiliser ?\"","item_backpack":"SacÀDos%s","item_backpack_text":"Il y a un sac à dos avec ouverture zippée super classe sur la table sans prix dessus. Sa toile est un peu éffiloché mais il semble robuste.\nTu jetes un coups d'oeil sur le vendeur mais son attention est ailleurs.\nUne incription apparaît près de la languette du sac : 'unzip'. ","item_backpack_stolen":"Tu viens de voler le sac à dos. \nÉtant donné que tu es fauché, et que tu ne travailles pas une odieuse multinationnale, \nRichard Stallman devrait être fier de toi.","item_mkdir_spell":"mkdir","item_mkdir_spell_text":"\"'mkdir' transforme les rêves en réalité. Invoque ce sort suivi du nom qui te convient crééra un nouveau chemin.\"","room_library":"Bibliothèque","room_library_text":"La bibiothèque est mal éclairée et sent la moisissure. \nPourtant, il y fait bon et la douce moquette verte te met à l'aise.","item_radspellbook":"SuperLivreDesSortilèges","item_radspellbook_text":"La légende parle d'un mot portant un grand pouvoir qui permet de faire toute action.\\","item_romancebook":"RomanceDePoche","item_romancebook_text":"Tu retournes le livre de poche et l'ouvre sur un page au hazard. \n\"Oh, Horace!\" s'écria Antonia , sa poitrine se bondant tandis qu'Horace déchirait habilement son corset par sa souple encadrure. Horace fit un grognement animal et saisit ses doigts avec ses mains puissantes...\n— tu fermes le livre sans intérêt et tu le reposes sur l'étagère .","item_historybook":"HistoireDeTerminus","item_historybook_text":"Ce livre semble intéressant, mais il y a trop de pages et l'écriture est vraiment petite. Voici un extrait:\n \n{{people_darkwizard}} ... un vielle légend parle d'un magicien qui divisera le pays...\n...seul une personne batisseuse de ce monde peut stopper le virus répandu par le {{people_darkwizard}}...\n...le pouvoir du  \"sudo\" pourrait être la seule faiblesse du {{people_darkwizard}}...","item_nostalgicbook":"NostalgieDuPays","item_nostalgicbook_text":"Le livre dit : \"Si tu es nostalgique de ton petit nid douillet,\n invoque juste 'cd ~' et tu y retournera instantanément. \nMais rappelle toi que ce sera plus compliqué de revenir.\"\n\n Plus loin, un histoire intitulée \"Solitidue\" dit qu'une magiciene avec un pull arc-en-ciel et des lunettes roses, pouvais revenir en un instant là d'où il venait, quelque soit l'endroit. Aussi, elle pouvait téléporter des objets à un endroit distant.\n La page suivant semble expliquer comment, mais elle a été déchirée.","item_vimbook":"VIMproved","item_vimbook_text":"Tu ouvres ce livre, et découvre une écriture étrange.\nUne intense lumière en jaillit et t'aveugle.\nC'est alors que le livre disparaît.","item_chat":"Discussions","item_chat_text":"Si tu reçois des messages d'autres personnes. C'est probablement parce l'instruction '{{cmd.mesg y}}' est présente dans ton profile.\nTu peux vérifier cela avec '{{cmd.cat}} .profile'.\nNormalement, les personnes en questions doivent avoir accès à la commande '{{cmd.talk}}' pour t'envoyer des messages.","item_lever":"IntrigantPanneau","item_lever_text":"Un panneau derrière l'étagère semble recouvrir une source de lumière.","item_lever_exec":"Par curiosité, tu le pousse, revelant une pièce secrète.","room_backroom":"PièceSecrete","room_backroom_text":"Derrière le panneau, tu trouve un bibliothéquaire seule avec un petit elfe.\n Tu espères ne pas les déranger.","people_grep":"Grep","people_grep_text":"L'elfe se tourne vers toi avec un regard aigri. \n\"Greeeeeep,\" dit-il solennellement.","people_librarian":"Bibliothéquaire","people_darkwizard":"Magus","people_darkwizard_pre":"le mage funeste","people_darkwizard_text":"MageFuneste","people_librarian_text":"\"? Oh, bonjour. Désolé pour le désordre,\n mais je suis très occupé dans mes recherches sur {{people_darkwizard_pre}} {{people_darkwizard}}.\nPeux tu me faire une faveur ? Pourrais tu me dire toutes les références à {{people_darkwizard}} dans le livre relatant \"{{item_historybook}}\". Mon assistant Grep peux t'aider.\" \nGrep te regarde avec un air mécontent. \"Greeepp.\"\n\"Pour chercher les occurences d'un terme dans un livre, écris simplement \"grep\" suivi du terme et de l'objet en question\n. Va trouver le livre et tape \"grep {{people_darkwizard}} {{item_historybook}}\".","room_rockypath":"CheminEnPierres","room_rockypath_text":"Le chemin mène vers des champs.","item_largeboulder":"ÉnormeRocher","item_largeboulder_text":"There is an enormous boulder blocking your way.\nIt's much too big to move.","item_largeboulder_rm":"The boulder disappears with a pop.","room_artisanshop":"BoutiqueArtisanale","room_artisanshop_text":"Les murs de la boutique sont couverts d'horloge dont les tics tacs sont légèrement désynchronisés.\nAu plan de travail, une femme avec un grosse paire de lunettes brandit un chalumeau avec un enthousiasme inquiétant. ","item_strangetrinket":"BabiolleÉtrange","item_strangetrinket_text":"Ça ressemble à une roche de cristal.","item_strangetrinket_rm":"T'as t'on déjà expliquer que certains objets ont une valeur plus grande pour une personne que pour une autre ?\nOn appelle cela la valeur sentimentale.","item_strangetrinket_mv":"Cette babiolle a surement une grande valeur pour cette femme ! En a t'elle pour toi ?","item_dragon":"Dragon","item_dragon_text":"Un dragon de la taille de 2 mètres de long parcours la pièce.\nTu aurais cru qu'il s'agit d'un vrai dragon si il n'avait pas une clef servant à remonter le mécanisme sur le dos.","item_dragon_rm":"Où est-ce que tu te crois ? Dans « Donjon et Dragons » ?","item_dragon_mv":"Cela a du prendre de nombreuses semaines pour réaliser ce Dragon mécanique.\nN'as tu donc pas de valeurs ?","people_artisan":"Artisan","people_artisan_text":"L'Artisan lève ses lunettes et te regarde avec surprise.\n\"Êtes-vous le nouvel assistant? Vous êtes en retard!\" ...\n\"Vous dites que vous n'êtes pas mon assistant? \nEh bien, cela ne signifie pas que vous ne pouvez pas vous rendre utile.\nJ'ai besoin de quelques rouages rapidement! ...\nVous ne savez même pas comment faire des choses?\nHmph. Et vous vous prétendrez être un assistant.\nDites simplement \"{{cmd.touch}}\" suivi du nom de la chose que vous voulez créer. Maintenant, faites-moi un {{item_gear}}! Revenez me parler ensuite.\"","item_gear":"rouage%s","item_gear_artisans_ok":"Ah, Déjà fini ? J'ai l'impression que tu apprends vite. \nMerci pour ton aide.","item_gear_text":"Ceci est un {{item_gear}}","item_gear_touch":"Euh... à quoi tu t'attends avec seulement un {{item_gear}} ?\nTu devrais être capable de la copier pourtant…\n*pfffff* T'as vraiment besoin d'entrainement.\n Écris seulement “{{cmd,[\"cp\"]}} [ITEM] [CLONE_DE_ITEM]”.\n[ITEM] est le nom de ce que tu va copier, et [CLONE_DE_ITEM] est le nom de la nouvelle copie.\nCompris ? Alors prouve le moi ! Voici un {{item_gear}}. Il m'en faut 5 autres.\nAppelle les  {{item_gear,[1]}}, {{item_gear,[2]}}, {{item_gear,[3]}}, {{item_gear,[4]}}, et {{item_gear,[5]}}, stp.","room_farm":"Ferme","room_farm_text":"Il y avait un ferme ici,\nmais les cultures ici ont été ravagées.","item_earofcorn":"EpisDeMais","item_earofcorn_text":"Ce maïs est triste et raci.","item_earofcorn_rm":"Pourquoi voudrais tu détruire la seul nourriture d'une personne affamée ?","item_another_earofcorn":"AutreEpisDeMais","item_another_earofcorn_text":"Ceci est un autre épis de maïs.","corn_farmer_ok":"C'est un miracle ! Merci mon ami. Que l'Admin te benisse.","people_farmer":"Fermier","people_farmer_text":"\"Ruiné ! Je suis ruiné ! Regardes ce champs de maïs… il n'en reste presque plus rien !\nLes soldats du {{people_darkwizard}} sont passés ici la semaine dernière… Ils ont tout détruit.\nComment vais-je nourrir mes enfants avec seulement un épi de maïs ?\nAvec au moins un {{item_another_earofcorn}}, je pourrais peut être en garder quelques graines.\"","room_clearing":"Clairière","room_clearing_text":"C'est un clairière couverte d'herbe avec une femme assise sur un rocher, soupirant...\nDerrière elle, les ruines d'une maison.","room_clearing_text2":"C'est une clairière couverte d'herbe avec une femme assise sur un rocher, soupirant...\nDerrière elle, une belle {{room_house}} neuve.","room_clearing_cd":"Tu ne peux pas traverser le pont tant que tu n'as pas remplacé la {{item_plank}} manquante.","people_cryingman":"FemmeEnPleur","people_cryingman_text":"<voice grl>\"Vous ! Vous faites partie des mercenaires du {{people_darkwizard}} ! Je peux la sentir : cette capacité étrange que vous avez.\nVous êtes venu finir le travail, n'est-ce pas ?\nAllez qu'est-ce que t'attends !? il n'y a rien de pire que vous puissiez m'enlever.\n\n<voice char>« Mais enfin ! que s'est-il passé ? »\n\n<voice grl>\\\"Qu'est-il arrivé ? Tu oses demander -- tu sais bien ce qu'il s'est passé enflure. \nTes copains, ils sont venus, il y a deux jours. Ils ont détruit ma maison, et enlevé mon pauvre enfant.\nMa femme est partie en ville pour trouver de l'aide, mais depuis, elle a disparu.\n\n<voice char>« C'est affreux. Que puis-je faire pour vous venir en aide ? »\n\n<voice grl>\\\"Comment !? D'accord, j'imagine que tu n'a rien à voir avec ceci. Tu ne ressembles pas aux soldats du {{people_darkwizard}}.\nJe suis peut être trop naïve, mais . \nSaurais tu me construire une nouvelle {{room_house}} ?","room_house":"Maison","room_house_text":"Ça ! C'est une {{room_house}}.","room_house_cd":"Tu entres dans la {{room_house}} construite de tes mains.","room_house_ls":"C'est toi qui l'a faite cette {{room_house}}. Prends quelques instants pour apprécier ta fierté !","room_clearing_less2":"Merci du fond du cœur pour m'avoir construit cette {{room_house}} ! J'en pleure de joie.\nY a t'il beaucoup d'autres personnes comme toi ?\nEs tu capable de libérer mon enfant ?\nDésolée. Je vous en demande beaucoup trop, mais tu es mon seul espoir pour retrouver ma famille.","room_brokenbridge":"BrokenBridge","room_brokenbridge_text":"A creaky wooden bridges stretches across a chasm.\nBut it's missing a {{item_plank}}, and the gap is too far to jump.","room_brokenbridge_text2":"Devant toi, un pont tenu par des cordes s'étend vers l'abîme.","item_plank":"Planche","item_plank_text":"C'est une {{item_plank}}.","room_ominouspath":"CheminInquiétant","room_ominouspath_text":"Ce chemin mène vers une cave très sombre. \nLe chemin est fait de pierres ordinaires, mais sans savoir pourquoi, passer par ici te fiche la trouille.","item_brambles":"RoncesTordues","item_brambles_text":"Ce tas de ronces est couvert d'épines qui ne t'inspire vraiment pas confiance.\nTu ne pas le contourner et tu n'essaiera surement pas de le traverser.\nPourtant, quelque chose te dit que derrière ce tas de ronces se trouve quelque chose d'important.","item_brambles_mv":"Tu ne pas toucher les ronces à cause de ces maudites épines.","item_brambles_rm":"Lorsque tu invoques '{{cmd.rm}}' sur le tas de ronces. Ces dernières émettent une lueur d'un bleu très profond.\nTu insistes et les ronces disparaîssent dans un nuage de fumée.","room_slide":"Toboggan","room_slide_text":"Au bout du long toboggan, tu aperçois une autre pièce.","room_slide_cd":"{{people_troll1}} bloque l'accès au toboggan.","room_slide_cd2":"C'est juste un toboggan. Tu ne sais pas si tu pourras remonter mais tu sais que tu dois y aller.","room_kernel":"KernelFiles","room_kernel_text":"The KernelFiles hold the sudo-secret (no, not pseudo). You'd better read the Instructions.","ask_password":"Password:","room_kernel_IHTFP":"You have correctly entered the password. You are now in Paradise. Take a look around, and congratulations.","item_certificate":"Certificate","item_certificate_text":"You must read the Certificate with the sudo password.","item_instructions":"Instructions","item_instructions_text":"You've learned how to make use of your friend grep I see. If you haven't it might be wise for you to go back to the Library again to do some reading. Because here, you'll need to use him to help you. Here is your task: \nThere are a lot of items in the MoreKernelFiles room and one of them contains the sudo password. This password is very powerful password that lets you do absolutely anything in the world. It lets you cast a spell on any item that is protected in any way. You know the password is contained in one of these .txt items. You know that it appears on a line that says the word: 'password='. You should find it with grep's help. Then you'll need to use the sudo spell to find Paradise. To do this, just Type 'sudo' before the command you want to run, like so: 'sudo cp ITEM_A ITEM_B'. You will then be prompted for the sudo password. Type the password, and the spell that comes after sudo will be cast. If you open the Certificate in Paradise with sudo, you will have truly found Paradise.","room_morekernel":"MoreKernelFiles","room_morekernel_text":"There are so many files here!","item_bigfile":"%s.txt","item_bigfile_text":"Alice was beginning to get very tired of sitting by her \nsister on the bank, and of having nothing to do: once or twice she had peeped into the \nbook her sister was reading, but it had no pictures or conversations in it, 'and what is \nthe use of a book,' thought Alice 'without pictures or conversation?' \n. . . \nCe texte contient des millions de mots.\nCela prendrait des heures de tout lire","item_bigfileM_text":"Alice was beginning to get very tired of sitting by her \nsister on the bank, and of having nothing to do: once or twice she had peeped into the \nbook her sister was reading, but it had no pictures or conversations in it, 'and what is \nthe use of a book,' thought Alice 'without pictures or conversation?' \n. . . \nCe texte contient des millions de mots.\nCela prendrait des heures de tout lire","item_bigfileQ_text":"Alice was beginning to get very tired of sitting by her \nsister on the bank, and of having nothing to do: once or twice she had peeped into the \nbook her sister was reading, but it had no pictures or conversations in it, 'and what is \nthe use of a book,' thought Alice 'without pictures or conversation?' \n. . . \nCe texte contient des millions de mots.\nCela prendrait des heures de tout lire","item_bigfileS_text":"Alice was beginning to get very tired of sitting by her \nsister on the bank, and of having nothing to do: once or twice she had peeped into the \nbook her sister was reading, but it had no pictures or conversations in it, 'and what is \nthe use of a book,' thought Alice 'without pictures or conversation?' \n. . . \nCe texte contient des millions de mots.\nCela prendrait des heures de tout lire","item_bigfileT_text":"Alice was beginning to get very tired of sitting by her \nsister on the bank, and of having nothing to do: once or twice she had peeped into the \nbook her sister was reading, but it had no pictures or conversations in it, 'and what is \nthe use of a book,' thought Alice 'without pictures or conversation?' \n. . . \nCe texte contient des millions de mots.\nCela prendrait des heures de tout lire","room_paradise":"Paradise","room_paradise_text":"You have truly found Paradise with the sudo password. \nCongratulations.","room_paradise_ls":"There's really nothing interesting in Paradise.","room_trollcave":"CaveOfDisgruntledTrolls","room_trollcave_text":"The cave is dark and smells like... feet? Oh, right, it's probably the trolls. \nThere's a scared-looking kid in a cage by the far wall.","people_troll1":"UglyTroll","people_troll1_text":"He looks mad, and really ugly.","people_troll1_mv":"The troll looks briefly surprised, then moves away.\nHe's mostly harmless anyway.","people_troll1_rm":"The troll looks briefy surprised, then vanishes \nwith an unpleasant squelching sound.","people_troll1_cp":"They're multiplying!","people_troll2":"UglierTroll","people_troll2_text":"He looks mad, and really, really ugly. \nBut he wants to tell you something. Between his \ngarbled grunts, you manage to understand the following: \nYou can cast spells on items that you don't currently see. For example, if you want \nto copy an item from this room to the OminousLookingPath from which you came, you can \ncp [ITEM_TO_COPY] ../[NEW_ITEM_NAME]. You can do this for most spells and most rooms. \nUse this knowledge wisely. Remember.... you can't undo an 'rm' spell.","people_supertroll":"AbsolutelyHideousTroll","people_supertroll_text":"You probably don't want to look at this guy. Oops, too late.","people_supertroll_rm":"The troll belches spectacularly, and you could swear he actually smirks. You won't get rid of him that easily, not without the 'sudo password'. It's not 'pseudo', it's 'sudo'. You'll find that in KernelFiles. But first you have to get past the UglyTroll to the Slide.","people_supertroll_mv":"If you move him out of the cave, he'll terrorize the countryside.\nAlso he will probably eat you.","room_cage":"Cage","room_cage_text":"Il y a un enfant terrifié dans cette cage.","room_cage_cd":"Tu ne peux pas te faufiler entre les barreaux de la cage. Et puis, ça va pas la tête ?\nPourquoi voudrais tu aller dans cette cage ? Tu envies le sort des animaux à fourrure ?\nCe {{people_supertroll}} pourrait te dépecer comme une clémentine.","people_kidnapped":"EnfantKidnapé","people_kidnapped_text":"Tu sais que ce n'est pas le moment de penser à cela,\nmais cet enfant tire vraiment une drôle de tête.","people_kidnapped_mv":"L'enfant regarde autour de lui, confus, surpris de se trouver hors de la cage.\nTu lui souris et lui dit avec une voix douce : \n<voice char> « Tu devrais rentrer chez toi p'tit gars. » \n<voice girl>\"Je suis une fille avec des cheveux courts. Pas un garçon manqué. Une fille ! Pourquoi il faut toujours être un garçon par défaut ? \", <voice char> dit la petite fille.\n Avant de précipiter vers la sortie, elle en profite pour donner un coups de pied dans le genou du {{people_supertroll}}.<voice girl>\"Je t'avais dit de me lâcher ! \"\n<voice char>Le {{people_supertroll}} se met alors à pleurer tandis que la petite s'échappe.","man_cd":"(Choisis ta destination) Utilise \"cd\" pour explorer le monde. \nIl faut écrire : cd CHEMIN","help_cd":"Se déplacer dans un autre chemin.","man_mv":"(MouVement). \nUtilise \"mv\" pour déplacer un objet. \nIl faut écrire : mv OBJET LIEU_DE_DESTINATION","help_mv":"Déplacer un objet dans un autre chemin.","man_ls":"(Regarde autour de toi). \nUtilise \"ls\" pour voir ce qui se trouve dans un chemin donné. \nSoit tu observes là où tu es, soit tu observes un autre chemin.\nIl faut écrire : \n  ls              (pour voir autour de toi) \n-OU- \n  ls CHEMIN     (pour voir là où tu ne peux pas choisir ta destination \"cd\" )","help_ls":"Décrire un chemin.","man_less":"(Lire, Examiner ou parler). \nUtilise \"less\" pour connaître les secrets liés à un objet. \nIl faut écrire : \n  less ITEM","help_less":"Utiliser ou lire un objet, ou bien parler à quelqu'un.","help_cat":"{{help_less}}","man_cat":"{{help_less}}","help_more":"{{help_less}}","man_man":"Le Grand Manuscrit possède le savoir indispensable aux sorciers.\nVoici les sorts que je pourrais t'enseigner : cd, ls, rm, mv, exit, help, man, touch, grep, pwd.","help_man":"En savoir plus sur un sort.","man_help":"Tapes \"help\" pour avoir une liste des sorts utilisables.","help_help":"Lister les sorts utilisables.","man_exit":"(quitter) \nUtilise \"exit\" pour quitter le jeu.","help_exit":"Quitter le jeu.","man cp":"(CoPy)\nUtilise \"{{cmd.cp}}\" pour cloner un item. \nIl faut écrire :\n  {{cmd.cp}} ITEM NEWNAME ","help_cp":"Copier un objet.","man_pwd":"(Te montre là où tu es) \nIl faut écrire : \n  \"{{cmd.pwd}}\" ","help_pwd":"Dire où tu es.","man_grep":"(gReP : Récupère des parties) \nUtilise \"{{cmd.grep}}\" pour trouver les parties d'un texte qui contiennent le mot magique.\nIl faut écrire : \n  grep MOT_MAGIQUE LÀ_OU_TU_CHERCHE ","help_grep":"Chercher quelque chose dans un texte.","man_touch":"(Touche) En touchant un objet (même imaginaire), tu le fais (re)naître comme neuf.\nUtilise \"{{cmd.touch}}\"  pour créer de nouveaux objets.\nIl faut écrire :\n  touch OBJET","help_touch":"Toucher un objet.","game_loaded":"Partie restaurée","room_kernel_sudo":"room_kernel_sudo","Suggestions":"Suggestions","cmd_poe_revealed":"cmd_poe_revealed","po_symbol_edit":"(édition - taper Ctrl + Entrée pour valider) ","po_symbol_unknown":"po_symbol_unknown"};
const APP_NAME='terminus';const LANG='fr';